import React, { Component } from 'react';
import Base from './base';
import UserInfo from './userdynamics/userinfo';
import UserPost from './userdynamics/userpost';

const Userdynamics = () => {
  return ( 
    <Base>
      <div className="row">
        <div className="col-3">
          <UserInfo />
        </div>
        <div className="col-9">
          <UserPost />
        </div>
      </div>
    </Base>
  );
}

export default Userdynamics
